class Box extends React.Component{
    render(){
        return (
            <div>
                <button onClick={()=>{this.props.handleClick()}}> Week 1</button>



{


    this.props.data.map(data =>
    <div  className='sportsScoreDiv'>
    <table border="0" width="90%" align="center">
        <tr>    
          <td align="left"><p class='teamName'>{data.awayTeamScore} {data.awayTeamSpread}</p></td>    
          <td align="right"><p class='teamName'>{data.awayTeamScore}</p></td>    
          <td align="right"><p class='teamName'>Final</p></td>                  
        </tr>
        <tr>  
        <td align="left"><p class='teamName'>{data.homeTeamName}</p></td> 
        <td align="right"><p class='teamName'>{data.homeTeamScore}</p></td>    
        <td align="right"><p class='teamName'></p></td>                      
        </tr> 
    </table>
    </div>
    )}


            </div>
        )

    }
}

export default Box;
